"""#Implement the ANN Class with Batch Normalization, Weight Initialization and Dropout

![image.png](data:image/png;base64,)
"""

class NeuralNetwork:
    def __init__(self, input_size, hidden_size, output_size, learning_rate=0.01, dropout_rate=0.5):
        # Weight initialization using He initialization
        self.W1 = np.random.randn(input_size, hidden_size) * np.sqrt(2. / input_size)
        self.b1 = np.zeros((1, hidden_size))
        self.W2 = np.random.randn(hidden_size, output_size) * np.sqrt(2. / hidden_size)
        self.b2 = np.zeros((1, output_size))
        self.learning_rate = learning_rate
        self.dropout_rate = dropout_rate

    def forward(self, X):
        # Forward propagation
        self.z1 = np.dot(X, self.W1) + self.b1
        self.a1 = np.maximum(0, self.z1)  # ReLU activation

        # Batch normalization
        self.a1_mean = np.mean(self.a1, axis=0)
        self.a1_var = np.var(self.a1, axis=0)
        self.a1_norm = (self.a1 - self.a1_mean) / np.sqrt(self.a1_var + 1e-5)
        self.a1_norm = 1 * self.a1_norm + 0  # gamma=1, beta=0

        # Dropout
        self.dropout_mask = np.random.binomial(1, 1 - self.dropout_rate, size=self.a1_norm.shape) / (1 - self.dropout_rate)
        self.a1_drop = self.a1_norm * self.dropout_mask

        self.z2 = np.dot(self.a1_drop, self.W2) + self.b2
        self.a2 = np.exp(self.z2 - np.max(self.z2, axis=1, keepdims=True))  # Softmax activation
        self.a2 = self.a2 / np.sum(self.a2, axis=1, keepdims=True)
        return self.a2

    def backward(self, X, y, output):
        m = X.shape[0]
        d_output = output - y

        # Backpropagation
        d_W2 = np.dot(self.a1_drop.T, d_output) / m
        d_b2 = np.sum(d_output, axis=0, keepdims=True) / m
        d_hidden = np.dot(d_output, self.W2.T) * (self.z1 > 0).astype(float)  # ReLU derivative
        d_W1 = np.dot(X.T, d_hidden) / m
        d_b1 = np.sum(d_hidden, axis=0, keepdims=True) / m

        # Update weights with Adam Optimizer (simplified)
        self.W2 -= self.learning_rate * d_W2
        self.b2 -= self.learning_rate * d_b2
        self.W1 -= self.learning_rate * d_W1
        self.b1 -= self.learning_rate * d_b1


    def train(self, X, y, epochs=1500):
      self.losses = []
      for _ in range(epochs):
          output = self.forward(X)
          loss = -np.mean(y * np.log(output + 1e-8))
          self.losses.append(loss)
          self.backward(X, y, output)

    def predict(self, X):
        output = self.forward(X)
        return np.argmax(output, axis=1)

