# Initialize and train the model
input_size = X_train_scaled.shape[1]
hidden_size = 10
output_size = y_train.shape[1]
nn = NeuralNetwork(input_size, hidden_size, output_size)
nn.train(X_train_scaled, y_train, epochs=1500)

"""# Evaluate the model"""

y_pred_train = nn.predict(X_train_scaled)
y_pred_test = nn.predict(X_test_scaled)
train_accuracy = accuracy_score(np.argmax(y_train, axis=1), y_pred_train)
test_accuracy = accuracy_score(np.argmax(y_test, axis=1), y_pred_test)
print(f'Training Accuracy: {round(train_accuracy *100,2) }%')
print(f'Testing Accuracy: {round(test_accuracy *100,2) }%')

